function timer() {
  var deadline = '2023-09-01';
  function getTimeRemaning(endtime) {
    var t = Date.parse(endtime) - Date.parse(new Date());
    var days = Math.floor(t / (1000 * 60 * 60 * 24));
    var hours = Math.floor(t / (1000 * 60 * 60) % 24);
    var minutes = Math.floor(t / 1000 / 60 % 24);
    var seconds = Math.floor(t / 1000 % 60);
    return {
      'total': t,
      'days': days,
      'hours': hours,
      'minutes': minutes,
      'seconds': seconds
    };
  }
  function getZero(num) {
    if (num >= 0 && num < 10) {
      return "0".concat(num);
    } else {
      return num;
    }
  }
  function setClock(selector, endtime) {
    var timer = $(selector);
    var days = timer.find('#days');
    var hours = timer.find('#hours');
    var minutes = timer.find('#minutes');
    var seconds = timer.find('#seconds');
    var timeInterval = setInterval(updateClock, 1000);
    updateClock();
    function updateClock() {
      var t = getTimeRemaning(endtime);
      days.text(getZero(t.days));
      hours.text(getZero(t.hours));
      minutes.text(getZero(t.minutes));
      seconds.text(getZero(t.seconds));
      if (t.total <= 0) {
        clearInterval(timeInterval);
      }
    }
  }
  setClock('.timer', deadline);
}

